def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""
    result = []
    for word in input1.split():
        segments = word.split('-')
        camel_case_word = segments[0] + ''.join(s.capitalize() for s in segments[1:])
        result.append(camel_case_word)
    return ' '.join(result)
